import { Button } from "bootstrap";
import React, { Component } from "react";

class Counter extends Component {
  state = { count: 0 };
  render() {
    return (
      <React.Fragment>
        <div>Counter: {this.state.count}</div>
        <button>Increment</button>
      </React.Fragment>
    );
  }
}

export default Counter;
